      </div>
      <div class = "box"style = {{paddingTop: 10}}>
      <p>Each month, the MusMe team updates the library with <h2>refreshing new music and sounds</h2> so users will never run out of new content. </p>

      </div>




    </div>
    <div class = "column">

    </div>

  </div>

  );
  return (
    <div> 
      {title}
      {content}
    </div>



  );
}

export default Home;
